import { useState } from "react"
import { useDispatch, useSelector } from "react-redux"
import { setMan } from "../redux/reducer/actions/loginAction"

export const Login=()=>{
const d=useDispatch()
    const [user,setuser]=useState({})

    return<div>
<input type="text" placeholder="הכנס שם" onBlur={(e)=>setuser({...user,name:e.target.value})}></input>
<input type="password" placeholder="הכנס סיסמא" onBlur={(e)=>setuser({...user,password:e.target.value})}></input>
<button onClick={()=>{d(setMan(user));}} >התחבר</button>

    </div>
   

}
